     1/**
     2 * WebSocket Server for Frontend Integration
     3 *
     4 * Broadcasts live autopilot events to connected clients.
     5 *
     6 * LOIS INTEGRATION PATH
     7 * =====================
     8 * This WebSocket server provides the protocol for frontend integration with the
     9 * token-analysis-autopilot. Data types here are designed for future LOIS live
    10 * trading compatibility.
    11 *
    12 * Current Status: Paper trading only (no real order execution)
    13 *
    14 * For live trading integration:
    15 * - SignalData.signalType maps to LOIS TriggerEvent types
    16 * - PositionData would need execution IDs, fill prices, and order status
    17 * - ConfigData.mode='live' path would route to LOIS order execution
    18 *
    19 * See LOIS compatibility markers on each interface for specific mapping notes.
    20 */
    21
    22import { WebSocketServer, WebSocket } from 'ws';
    23import type { PaperTrade } from './trading/types.js';
    24import type { TokenMarketData, OHLCV, Trade } from './api/types.js';
    25
    26// Event types the frontend can receive
    27export type AutopilotEvent =
    28  | { type: 'position_update'; positions: PositionData[] }
    29  | { type: 'signal'; signal: SignalData }
    30  | { type: 'market_status'; status: MarketStatusData }
    31  | { type: 'stats_update'; stats: StatsData }
    32  | { type: 'scan_tick'; tick: ScanTickData }
    33  | { type: 'token_list'; tokens: TokenListData }
    34  | { type: 'config'; config: ConfigData }
    35  | { type: 'strategies'; strategies: StrategiesData }
    36  | { type: 'last_analysis'; analysis: LastAnalysisData };
    37
    38// Command types the frontend can send
    39export type AutopilotCommand =
    40  | { command: 'toggle_sources'; enabled: boolean }
    41  | { command: 'toggle_trending'; enabled: boolean }
    42  | { command: 'toggle_whales'; enabled: boolean }
    43  | { command: 'toggle_filter'; enabled: boolean }
    44  | { command: 'set_mode'; mode: 'paper' | 'live' }
    45  | { command: 'set_position_size'; sizeSol: number }
    46  | { command: 'refresh_sources' }
    47  | { command: 'get_config' }
    48  | { command: 'get_strategies' }
    49  | { command: 'toggle_strategy'; strategyId: string; enabled: boolean }
    50  | { command: 'close_position'; mint: string }
    51  | { command: 'close_all_positions' };
    52
    53// CVD (Cumulative Volume Delta) data for volume analysis
    54export interface CVDData {
    55  mint: string;
    56  timestamp: number;
    57  cvd: number;           // Current cumulative volume delta
    58  cvdChange: number;     // Change over period
    59  buyVolume: number;     // Buy volume in period
    60  sellVolume: number;    // Sell volume in period
    61  netDelta: number;      // buyVolume - sellVolume for period
    62  periodMs: number;      // Period length (e.g., 60000 for 1m)
    63}
    64
    65// Trending data from frontend NATS subscription
    66export interface TrendingFeedItem {
    67  mint: string;
    68  symbol: string;
    69  name: string;
    70  rank: number;
    71  volume_usd: number;
    72  resolution: '5m' | '1h' | '6h' | '24h';
    73}
    74
    75// Whale move data from frontend NATS subscription
    76export interface WhaleMoveFeedItem {
    77  mint: string;
    78  symbol: string;
    79  whale_count: number;
    80  volume_usd: number;
    81}
    82
    83// Data feed message types for incoming market data from main app
    84export type DataFeedMessage =
    85  | { type: 'market_data_feed'; data: TokenMarketData }
    86  | { type: 'ohlcv_update'; mint: string; ohlcv: OHLCV[] }
    87  | { type: 'trade_feed'; trade: Trade }
    88  | { type: 'cvd_update'; data: CVDData }
    89  | { type: 'trending_feed'; tokens: TrendingFeedItem[]; resolution: '5m' | '1h' | '6h' | '24h' }
    90  | { type: 'whale_feed'; tokens: WhaleMoveFeedItem[] };
    91
    92// Union of all incoming message types
    93export type IncomingMessage = AutopilotCommand | DataFeedMessage;
    94
    95// Handler type for data feed messages
    96export type DataFeedHandler = (message: DataFeedMessage) => void;
    97
    98// LOIS COMPATIBLE: partial
    99// - mode field controls paper vs live execution path
   100// - For live trading: would add walletAddress, rpcEndpoint, and slippage config
   101// - positionSizeSol used for both paper and live
   102export interface ConfigData {
   103  autoSourcesEnabled: boolean;
   104  trendingEnabled: boolean;
   105  whalesEnabled: boolean;
   106  marketFilterEnabled: boolean;
   107  mode: 'paper' | 'live';
   108  positionSizeSol: number;
   109  pollIntervalMs: number;
   110}
   111
   112// LOIS COMPATIBLE: yes
   113// - Strategy templates are execution-agnostic (same for paper and live)
   114// - id maps directly to LOIS strategy identifiers
   115export interface StrategyInfo {
   116  id: string;
   117  name: string;
   118  description: string;
   119  mode: 'all' | 'any';
   120  ruleCount: number;
   121  summary: string; // Compact rule summary
   122}
   123
   124// LOIS COMPATIBLE: yes
   125// - Strategy state is execution-agnostic
   126// - active[] array used for both paper and live mode filtering
   127export interface StrategiesData {
   128  available: StrategyInfo[];  // All available templates
   129  active: string[];           // IDs of currently active strategies
   130}
   131
   132export type CommandHandler = (command: AutopilotCommand) => Promise<void> | void;
   133
   134// LOIS COMPATIBLE: partial
   135// - Paper trading only: no execution IDs, fill prices, or order status
   136// - For live trading: add txSignature, executionPrice, fillStatus, orderId
   137// - entryPriceSol is simulated in paper mode, would be actual fill in live
   138// - Frontend calculates P&L from NATS market data (same for paper and live)
   139export interface PositionData {
   140  mint: string;
   141  symbol: string;
   142  action: 'buy' | 'sell';
   143  entryPriceSol: number;
   144  positionSizeSol: number;
   145  entryTime: number;
   146}
   147
   148// LOIS COMPATIBLE: partial
   149// - signalType maps to LOIS TriggerEvent:
   150//   * magic_buy -> TriggerEvent.ENTRY_SIGNAL
   151//   * magic_exit, dump_exit -> TriggerEvent.EXIT_SIGNAL
   152//   * rule_signal -> TriggerEvent.STRATEGY_MATCH
   153// - For live trading: add confidence score, urgency level, slippage tolerance
   154export interface SignalData {
   155  timestamp: number;
   156  mint: string;
   157  symbol: string;
   158  signalType: 'magic_buy' | 'magic_exit' | 'dump_exit' | 'rule_signal';
   159  action: 'buy' | 'sell' | 'close';
   160  reason: string;
   161  pnlPercent?: number;
   162  entryType?: string;
   163}
   164
   165// LOIS COMPATIBLE: yes
   166// - Market risk assessment used for both paper and live trading gates
   167// - blockEntries and exitAll flags control LOIS execution in live mode
   168export interface MarketStatusData {
   169  state: 'NORMAL' | 'CAUTION' | 'DUMP';
   170  solPriceChangePercent: number;
   171  blockEntries: boolean;
   172  exitAll: boolean;
   173}
   174
   175// LOIS COMPATIBLE: yes
   176// - Aggregate stats format identical for paper and live trading
   177// - PnL values are realized (closed trades) - same calculation method
   178export interface StatsData {
   179  totalTrades: number;
   180  openTrades: number;
   181  closedTrades: number;
   182  wins: number;
   183  losses: number;
   184  winRate: number;
   185  totalPnlSol: number;
   186  totalPnlUsd: number;
   187  avgPnlPercent: number;
   188}
   189
   190// LOIS COMPATIBLE: yes
   191// - Scan metadata format identical for paper and live trading
   192// - Provides heartbeat/liveness indication for UI
   193export interface ScanTickData {
   194  timestamp: number;
   195  scanNumber: number;
   196  tokenCount: number;
   197  openPositions: number;
   198}
   199
   200// Last analyzed token result - for UI debugging/visibility
   201export interface LastAnalysisData {
   202  mint: string;
   203  symbol: string;
   204  timestamp: number;
   205  priceChange5m: number | null;
   206  priceChange1h: number | null;
   207  volumeRatio: number | null;
   208  buyersCount: number | null;
   209  sellersCount: number | null;
   210  buySellRatio: number | null;
   211  rulesChecked: number;
   212  rulesMatched: number;
   213  outcome: 'no_signal' | 'buy_signal' | 'sell_signal' | 'skipped';
   214  reason: string;
   215}
   216
   217// LOIS COMPATIBLE: yes
   218// - Token discovery/watchlist format identical for paper and live
   219// - hasPosition flag indicates active position (paper or live)
   220export interface WatchedToken {
   221  mint: string;
   222  symbol: string;
   223  source: 'watchlist' | 'trending' | 'whales';
   224  priceSol?: number;
   225  priceUsd?: number;
   226  change1h?: number;
   227  change24h?: number;
   228  volume24h?: number;
   229  mcap?: number;
   230  hasPosition?: boolean;
   231}
   232
   233// LOIS COMPATIBLE: yes
   234// - Token list aggregation identical for paper and live
   235// - Sources can be toggled independently in both modes
   236export interface TokenListData {
   237  watchlist: WatchedToken[];
   238  trending: WatchedToken[];
   239  whales: WatchedToken[];
   240}
   241
   242export type ConnectHandler = () => void;
   243
   244class AutopilotWebSocketServer {
   245  private wss: WebSocketServer | null = null;
   246  private clients: Set<WebSocket> = new Set();
   247  private port: number = 8765;
   248  private commandHandler: CommandHandler | null = null;
   249  private connectHandler: ConnectHandler | null = null;
   250  private dataFeedHandler: DataFeedHandler | null = null;
   251
   252  // In-memory storage for incoming market data feeds
   253  private marketData: Map<string, TokenMarketData> = new Map();
   254  private ohlcvData: Map<string, OHLCV[]> = new Map();
   255  private cvdData: Map<string, CVDData> = new Map();
   256  private recentTrades: Trade[] = [];
   257  private readonly MAX_RECENT_TRADES = 1000;
   258  private trendingTokens: Map<string, TrendingFeedItem> = new Map();
   259  private whaleTokens: Map<string, WhaleMoveFeedItem> = new Map();
   260
   261  start(port: number = 8765): void {
   262    if (this.wss) {
   263      console.log('[WS] Server already running');
   264      return;
   265    }
   266
   267    this.port = port;
   268    this.wss = new WebSocketServer({ port });
   269
   270    this.wss.on('connection', (ws) => {
   271      this.clients.add(ws);
   272      console.log(`[WS] Client connected (${this.clients.size} total)`);
   273
   274      // Notify handler to send initial state to new client
   275      if (this.connectHandler) {
   276        this.connectHandler();
   277      }
   278
   279      // Handle incoming messages (commands from frontend or data feeds from main app)
   280      ws.on('message', async (data) => {
   281        try {
   282          const message = JSON.parse(data.toString()) as IncomingMessage;
   283
   284          // Check if it's a command (has 'command' field)
   285          if ('command' in message && this.commandHandler) {
   286            console.log(`[WS] Command received: ${message.command}`);
   287            await this.commandHandler(message);
   288          }
   289          // Check if it's a data feed (has 'type' field matching data feed types)
   290          else if ('type' in message && this.isDataFeedMessage(message)) {
   291            this.handleDataFeed(message as DataFeedMessage);
   292          }
   293        } catch (err) {
   294          console.error('[WS] Failed to parse message:', err);
   295        }
   296      });
   297
   298      ws.on('close', () => {
   299        this.clients.delete(ws);
   300        console.log(`[WS] Client disconnected (${this.clients.size} total)`);
   301      });
   302
   303      ws.on('error', (err) => {
   304        console.error('[WS] Client error:', err.message);
   305        this.clients.delete(ws);
   306      });
   307    });
   308
   309    this.wss.on('error', (err) => {
   310      console.error('[WS] Server error:', err.message);
   311    });
   312
   313    console.log(`[WS] Server started on port ${port}`);
   314  }
   315
   316  // Register a handler for incoming commands
   317  onCommand(handler: CommandHandler): void {
   318    this.commandHandler = handler;
   319  }
   320
   321  // Register a handler for new client connections (to send initial state)
   322  onConnect(handler: ConnectHandler): void {
   323    this.connectHandler = handler;
   324  }
   325
   326  // Register a handler for incoming data feed messages
   327  onDataFeed(handler: DataFeedHandler): void {
   328    this.dataFeedHandler = handler;
   329  }
   330
   331  // Type guard to check if message is a data feed type
   332  private isDataFeedMessage(message: IncomingMessage): message is DataFeedMessage {
   333    if (!('type' in message)) return false;
   334    const type = (message as { type?: string }).type;
   335    return type === 'market_data_feed' || type === 'ohlcv_update' || type === 'trade_feed' || type === 'cvd_update' || type === 'trending_feed' || type === 'whale_feed';
   336  }
   337
   338  // Handle incoming data feed messages
   339  private handleDataFeed(message: DataFeedMessage): void {
   340    console.log(`[WS] Data feed received: ${message.type}${message.type === 'market_data_feed' ? ` (${message.data.mint.slice(0, 8)}...)` : ''}`);
   341    switch (message.type) {
   342      case 'market_data_feed':
   343        // Upsert market data by mint
   344        this.marketData.set(message.data.mint, message.data);
   345        break;
   346
   347      case 'ohlcv_update':
   348        // Replace OHLCV array for mint
   349        this.ohlcvData.set(message.mint, message.ohlcv);
   350        break;
   351
   352      case 'trade_feed':
   353        // Add to recent trades, maintain max size (circular buffer)
   354        this.recentTrades.push(message.trade);
   355        if (this.recentTrades.length > this.MAX_RECENT_TRADES) {
   356          this.recentTrades.shift();
   357        }
   358        break;
   359
   360      case 'cvd_update':
   361        // Upsert CVD data by mint
   362        this.cvdData.set(message.data.mint, message.data);
   363        break;
   364
   365      case 'trending_feed':
   366        console.log(`[WS] Data feed received: trending_feed (${message.tokens.length} tokens, ${message.resolution})`);
   367        // Clear and repopulate trending tokens Map
   368        this.trendingTokens.clear();
   369        for (const token of message.tokens) {
   370          this.trendingTokens.set(token.mint, token);
   371        }
   372        break;
   373
   374      case 'whale_feed':
   375        console.log(`[WS] Data feed received: whale_feed (${message.tokens.length} tokens)`);
   376        // Clear and repopulate whale tokens Map
   377        this.whaleTokens.clear();
   378        for (const token of message.tokens) {
   379          this.whaleTokens.set(token.mint, token);
   380        }
   381        break;
   382    }
   383
   384    // Notify handler if registered
   385    if (this.dataFeedHandler) {
   386      this.dataFeedHandler(message);
   387    }
   388  }
   389
   390  // Getter methods for rule engine access
   391  getMarketData(mint: string): TokenMarketData | undefined {
   392    return this.marketData.get(mint);
   393  }
   394
   395  getAllMarketData(): Map<string, TokenMarketData> {
   396    return this.marketData;
   397  }
   398
   399  getOHLCV(mint: string): OHLCV[] | undefined {
   400    return this.ohlcvData.get(mint);
   401  }
   402
   403  getCVD(mint: string): CVDData | undefined {
   404    return this.cvdData.get(mint);
   405  }
   406
   407  getAllCVD(): Map<string, CVDData> {
   408    return this.cvdData;
   409  }
   410
   411  getRecentTrades(mint?: string): Trade[] {
   412    if (mint) {
   413      return this.recentTrades.filter(t => t.mint === mint);
   414    }
   415    return this.recentTrades;
   416  }
   417
   418  getTrendingTokens(): Map<string, TrendingFeedItem> {
   419    return this.trendingTokens;
   420  }
   421
   422  getWhaleTokens(): Map<string, WhaleMoveFeedItem> {
   423    return this.whaleTokens;
   424  }
   425
   426  stop(): void {
   427    if (!this.wss) return;
   428
   429    for (const client of this.clients) {
   430      client.close();
   431    }
   432    this.clients.clear();
   433    this.wss.close();
   434    this.wss = null;
   435    console.log('[WS] Server stopped');
   436  }
   437
   438  broadcast(event: AutopilotEvent): void {
   439    if (this.clients.size === 0) return;
   440
   441    const message = JSON.stringify(event);
   442    for (const client of this.clients) {
   443      if (client.readyState === WebSocket.OPEN) {
   444        client.send(message);
   445      }
   446    }
   447  }
   448
   449  // Convenience methods for specific event types
   450  broadcastPositions(positions: PositionData[]): void {
   451    this.broadcast({ type: 'position_update', positions });
   452  }
   453
   454  broadcastSignal(signal: SignalData): void {
   455    this.broadcast({ type: 'signal', signal });
   456  }
   457
   458  broadcastMarketStatus(status: MarketStatusData): void {
   459    this.broadcast({ type: 'market_status', status });
   460  }
   461
   462  broadcastStats(stats: StatsData): void {
   463    this.broadcast({ type: 'stats_update', stats });
   464  }
   465
   466  broadcastScanTick(tick: ScanTickData): void {
   467    this.broadcast({ type: 'scan_tick', tick });
   468  }
   469
   470  broadcastTokenList(tokens: TokenListData): void {
   471    this.broadcast({ type: 'token_list', tokens });
   472  }
   473
   474  broadcastLastAnalysis(analysis: LastAnalysisData): void {
   475    this.broadcast({ type: 'last_analysis', analysis });
   476  }
   477
   478  broadcastConfig(config: ConfigData): void {
   479    this.broadcast({ type: 'config', config });
   480  }
   481
   482  broadcastStrategies(strategies: StrategiesData): void {
   483    this.broadcast({ type: 'strategies', strategies });
   484  }
   485
   486  getClientCount(): number {
   487    return this.clients.size;
   488  }
   489
   490  isRunning(): boolean {
   491    return this.wss !== null;
   492  }
   493}
   494
   495// Singleton instance
   496export const wsServer = new AutopilotWebSocketServer();
   497

