     1/**
     2 * useAutopilotSubscription
     3 *
     4 * Manages the autopilot WebSocket subscription and auto-subscribes to
     5 * NATS market_data topics for all position mints AND tokenList mints.
     6 *
     7 * Token sources:
     8 * - Watchlist: From user's watchlist API (tokens they've starred in the app)
     9 * - Whale moves: From Discovery API (1s refresh)
    10 * - Trending: From WebSocket discovery_trending_list store (same as Discovery/Overwatch)
    11 */
    12
    13import { useEffect, useRef, useMemo } from "react";
